var audio = document.getElementById("myAudio");

function myfun(){
    kol.style.animation = 'spin 5s ease';
    setTimeout(() => {
        kol.style.animationFillMode = 'forwards';
        speen.style.display = 'none';
        speen1.style.display = 'block';
        ftext.style.display = 'none';
        sec_text.style.display = 'block';
        first_pop.style.display = 'block';
        first_pop.style.animation = 'slideDown 1s ease';
        first_pop.style.animationFillMode = 'forwards';
        audio.play();
        setTimeout(() => {
            first_pop.style.animation = 'slideUp 1s ease';
            first_pop.style.animationFillMode = 'forwards';
        }, 2000);
    }, 4900);
}

function myfunn(){
    kol.style.animation = 'speenn 5s ease';
    setTimeout(() => {
        kol.style.animationFillMode = 'forwards';
        speen1.style.display = 'none';
        speennn.style.display = 'block';
        sec_text.style.display = 'none';
        third_text.style.display = 'block';

        sec_pop.style.animationFillMode = 'forwards';
        audio.play();
        setTimeout(() => {
            sec_pop.style.animation = 'slideUp 1s ease';
            sec_pop.style.animationFillMode = 'forwards';
        }, 2000);
    }, 4900);
}
function myfunnn(){
    kol.style.animation = 'spennn 5s ease';
    setTimeout(() => {
        kol.style.animationFillMode = 'forwards';
        speennn.style.display = 'none';
        speen_last.style.display = 'block';
        third_text.style.display = 'none';
        last_text.style.display = 'block';
        third_pop.style.display = 'block';
        third_pop.style.animation = 'slideDown 1s ease';
        third_pop.style.animationFillMode = 'forwards';
        audio.play();
        setTimeout(() => {
            third_pop.style.animation = 'slideUp 1s ease';
            third_pop.style.animationFillMode = 'forwards';
        }, 2000);
        setTimeout(() => {
            overlay_norm.style.opacity = 1;
            overlay_norm.style.zIndex = 3;
            Overlay_mob.style.opacity = 1;
            Overlay_mob.style.zIndex = 3;
            btn.style.display = 'block';
            btn.style.zIndex = 4;
        }, 2500);
    }, 4900);
}

function checkOrientation() {
    if (window.orientation === undefined) {
      console.log('Ориентация не поддерживается в данном браузере');
      return;
    }
  
    if (Math.abs(window.orientation) === 90) {
      console.log('Устройство в ландшафтной ориентации');
      Overlay_mob.style.display = 'none';
      overlay_norm.style.display = 'block';

    } else {
      console.log('Устройство в портретной ориентации');
      overlay_norm.style.display = 'none';
      Overlay_mob.style.display = 'block';
    }
  }
  
  // Вызовите функцию при загрузке страницы и при изменении ориентации
  window.addEventListener('load', checkOrientation);
  window.addEventListener('orientationchange', checkOrientation);
